import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import ConfirmPage from './ConfirmPage';
import { HashRouter as Router, Routes, Route } from 'react-router-dom';

// Páginas simples para rotas finais
function Pagamento() {
  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center text-center">
      <h1 className="text-3xl font-bold mb-2">Pagamento</h1>
      <p className="text-gray-400">Agora a outra parte deve transferir o valor por Pix.</p>
    </main>
  );
}

function Cancelado() {
  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center text-center">
      <h1 className="text-3xl font-bold mb-2">Operação cancelada</h1>
      <p className="text-gray-400">O outro usuário recusou a transação.</p>
    </main>
  );
}

// Renderização principal com roteamento via HashRouter
ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/confirmar" element={<ConfirmPage />} />
        <Route path="/pagamento" element={<Pagamento />} />
        <Route path="/cancelado" element={<Cancelado />} />
      </Routes>
    </Router>
  </React.StrictMode>
);
